import './App.css';
import Hello from './Hello';
import EssayForm from './Form';
import Header from './Header';
import Menu from './MenuApp';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Menu />
      </header>

      <Header />
      <EssayForm />

      <p>
        <Hello />
      </p>
      <p></p>
    </div>
  );
}

export default App;
